import React from "react";
import{
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';

import './App.css';
import CartSite from "./CartSite"
import Cart from './Components/Cart/Cart';
import Dishes from './Components/DieshesComponets/Dishes';
import AllCategories from './Components/Filter/AllCategories';

function App() {
  return (
    <div className="App">
      <Router>
        <div>
        <div>
          <h1>Salvator</h1>
        </div>
        <nav>
          <Link to="/cart"><img src="cart_2420157.png" alt="Zum Einkaufskorb" width="50px"/></Link>
        </nav>
        </div>
        <Routes>
          <Route path="/cart" element={<CartSite/>}></Route>
        </Routes>
      </Router>

     <AllCategories/>
     <Dishes/>
     <Cart/>


    </div>
  );
}

export default App;
